//tableumum with button sortir
$(function () {
	$('#tableumumtombol').DataTable( {
		"rowReorder": true,
		"processing": true,
		"serverSide": false,
		"paging": true,
		"lengthChange": true,
		"searching": true,
		"ordering": false,
		"info": true,
		"autoWidth": false,
		"language": {
			"sProcessing":   "Sedang memproses...",
			"sLengthMenu":   "Tampilkan _MENU_ data",
			"sZeroRecords":  "Tidak ditemukan",
			"sInfo":         "Menampilkan _START_ sampai _END_ dari _TOTAL_ data",
			"sInfoEmpty":    "Menampilkan 0 sampai 0 dari 0 data",
			"sInfoFiltered": "(disaring dari _MAX_ data keseluruhan)",
			"sInfoPostFix":  "",
			"sSearch":       "Cari:",
			"sUrl":          "",
			"oPaginate": {
				"sFirst":    "Pertama",
				"sPrevious": "Sebelumnya",
				"sNext":     "Selanjutnya",
				"sLast":     "Terakhir"
			}
		},
		"dom":            "Bfrtip",
		"buttons":        [ "colvis" ],
		"scrollY":        "300px",
        "scrollX":        true,
        "scrollCollapse": true,
        "fixedColumns":   {
            "leftColumns": 2
        },
		"order": [[ 0, "desc" ]],
		"pageLength": 100
	} );
} );

